import React from "react";
import "./Information.css";


function Info(params) {

    return (
        <section className="Info" >


            <div className="uk-container">

                <div className="uk-child-width-1-2@m uk-grid-match" uk-grid="true">

                    <div>

                    </div>

                    <div>
                        <div className="uk-card info-card uk-card-default uk-card-body uk-card-hover">
                            <img src="https://img.icons8.com/external-vitaliy-gorbachev-blue-vitaly-gorbachev/60/000000/external-bird-st-patrick-day-vitaliy-gorbachev-blue-vitaly-gorbachev.png" />
                            <h2 className="uk-card-title function-title"> ExamBird </h2>
                        </div>
                    </div>

                </div>


            </div>


        </section>
    )

}

export default Info;
